package org.apache.commons.net.ftp;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

import java.io.File;
import java.io.FileWriter;
import java.io.IOException;
import java.net.URL;
import java.util.Properties;

public class FTPClientTest1 {

    @Test
    public void testLoadResourceProperties() throws IOException {
        // Step 0 & 1: Attempt to load configuration with no resource path provided
        Properties load_result_1 = FTPClient.loadResourceProperties(null);
        assertNull(load_result_1, "Properties object should be null when path is null");

        // Step 2, 3 & 4: Attempt to load configuration from a non-existent path
        String non_existent_path = "non/existent/path.properties";
        Properties load_result_2 = FTPClient.loadResourceProperties(non_existent_path);
        assertNull(load_result_2, "Properties object should be null for non-existent path");

        // Step 5, 6 & 7: Attempt to access an unavailable system configuration resource
        String unavailable_resource_path = "/system.properties";
        Properties load_result_3 = FTPClient.loadResourceProperties(unavailable_resource_path);
        assertNull(load_result_3, "Properties object should be null for unavailable system resource");

        // Step 8 & 9: Attempt to load configuration with an empty path
        Properties default_configuration = FTPClient.loadResourceProperties("");
        assertNotNull(default_configuration, "Default configuration should not be null");
        assertFalse(default_configuration.isEmpty(), "Default configuration should not be empty");

        // Step 10, 11 & 12: Attempt to load configuration from a valid resource path
        String valid_resource_path = "testconfig.properties";

        // Create the properties file in the same directory as the test class
        URL testClassUrl = FTPClientTest.class.getResource("FTPClientTest.class");
        File testClassFile = new File(testClassUrl.getPath());
        File propertiesFile = new File(testClassFile.getParent(), valid_resource_path);

        try (FileWriter writer = new FileWriter(propertiesFile)) {
            writer.write("test.key=test.value\n");
        }
        propertiesFile.deleteOnExit();

        Properties loaded_configuration = FTPClient.loadResourceProperties(valid_resource_path);
        assertNotNull(loaded_configuration, "Properties object should not be null for a valid path");
        assertFalse(loaded_configuration.isEmpty(), "Properties should not be empty for a valid path");
        assertEquals("test.value", loaded_configuration.getProperty("test.key"), "Property from file should be loaded");
    }
}

