import static org.junit.jupiter.api.Assertions.*;

import java.io.ByteArrayOutputStream;
import java.io.IOException;
import java.net.DatagramPacket;
import java.net.InetAddress;
import java.util.Map;

public class TFTPRequestPacketTest1 {

    @Test
    public void testGetOptions() throws IOException, TFTPPacketException {
        // Step 0: Define a file transfer request
        ByteArrayOutputStream baos = new ByteArrayOutputStream();
        baos.write(new byte[]{0, 1}); // RRQ opcode
        baos.write("test.txt".getBytes());
        baos.write(0);
        baos.write("octet".getBytes());
        baos.write(0);
        baos.write("blksize".getBytes());
        baos.write(0);
        baos.write("1024".getBytes());
        baos.write(0);
        byte[] buffer = baos.toByteArray();

        DatagramPacket request_datagram = new DatagramPacket(buffer, buffer.length, InetAddress.getLocalHost(), 1234);

        // Step 1: The system processes the incoming file transfer request
        TFTPReadRequestPacket file_transfer_request = (TFTPReadRequestPacket) TFTPPacket.newTFTPPacket(request_datagram);

        // Step 2: Verify the system produces a human-readable summary of the request
        file_transfer_request.toString();

        // Step 3: Extract the negotiation parameters from the processed request output
        Map<String, String> extracted_parameters = file_transfer_request.getOptions();

        // Step 4: Assert that exactly one configuration option was extracted
        assertEquals(1, extracted_parameters.size());

        // Step 5: Assert the parameter name matches the expected negotiation key for block size
        assertEquals("blksize", extracted_parameters.keySet().iterator().next());

        // Step 6: Assert the parameter value matches the block size from the client's request
        assertEquals("1024", extracted_parameters.get("blksize"));
    }
}

