import java.net.UnknownHostException;
import java.nio.charset.StandardCharsets;

public class TFTPReadRequestPacketTest1 {

    private DatagramPacket createReadRequestPacket() throws UnknownHostException, IOException {
        String filename = "test.txt";
        String mode = "octet";
        String blksize = "blksize";
        String blksizeValue = "512";

        ByteArrayOutputStream baos = new ByteArrayOutputStream();
        baos.write(0);
        baos.write(TFTPPacket.READ_REQUEST);
        baos.write(filename.getBytes(StandardCharsets.UTF_8));
        baos.write(0);
        baos.write(mode.getBytes(StandardCharsets.UTF_8));
        baos.write(0);
        baos.write(blksize.getBytes(StandardCharsets.UTF_8));
        baos.write(0);
        baos.write(blksizeValue.getBytes(StandardCharsets.UTF_8));
        baos.write(0);

        byte[] data = baos.toByteArray();
        return new DatagramPacket(data, data.length, InetAddress.getLocalHost(), 12345);
    }

    @Test
    public void testNewDatagram() throws Exception {
        // Step 0: Construct a TFTP read request datagram
        DatagramPacket tftp_read_request_datagram = createReadRequestPacket();

        // Step 1: Construct a TFTP Read Request Packet instance by parsing the datagram
        TFTPReadRequestPacket tftp_read_request_packet = (TFTPReadRequestPacket) TFTPPacket.newTFTPPacket(tftp_read_request_datagram);

        // Step 2: Call the parameterless newDatagram method on the request packet
        DatagramPacket reconstructed_datagram = tftp_read_request_packet.newDatagram();

        // Step 3: Verify the reconstructed datagram is not null
        assertNotNull(reconstructed_datagram);

        // Step 4: Assert the reconstructed datagram's properties match the original
        assertEquals(tftp_read_request_datagram.getAddress(), reconstructed_datagram.getAddress());
        assertEquals(tftp_read_request_datagram.getPort(), reconstructed_datagram.getPort());
        assertEquals(tftp_read_request_datagram.getLength(), reconstructed_datagram.getLength());
        assertArrayEquals(tftp_read_request_datagram.getData(), reconstructed_datagram.getData());

        // Step 5: Allocate a byte array sized to match the original datagram's length
        byte[] destination_buffer = new byte[tftp_read_request_datagram.getLength()];

        // Step 6: Construct a new datagram packet targeting localhost with the allocated buffer
        DatagramPacket destination_datagram = new DatagramPacket(destination_buffer, destination_buffer.length, InetAddress.getLocalHost(), 0);

        // Step 7: Call the two-parameter newDatagram method
        tftp_read_request_packet.newDatagram(destination_datagram, destination_buffer);

        // Step 8: Verify the populated datagram's address and port match the original
        assertEquals(tftp_read_request_datagram.getAddress(), destination_datagram.getAddress());
        assertEquals(tftp_read_request_datagram.getPort(), destination_datagram.getPort());

        // Step 9: Confirm the byte buffer contains data identical to the original
        assertArrayEquals(tftp_read_request_datagram.getData(), destination_buffer);
    }
}

package org.apache.commons.net.tftp;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

import java.net.DatagramPacket;
import java.net.InetAddress;
import java.io.ByteArrayOutputStream;
import java.io.IOException;

public class TFTPRequestPacketTest1 {

    @Test
    public void testPacketReproduction() throws Exception {
        String resource_name = "test.txt";
        int transfer_format_preferences = TFTP.ASCII_MODE;
        InetAddress local_network_destination = InetAddress.getLocalHost();
        int port = 69;

        // Step 0: Prepare a file read request
        TFTPReadRequestPacket file_read_request = new TFTPReadRequestPacket(local_network_destination, port, resource_name, transfer_format_preferences);

        // Step 1: Generate a new transmission packet
        DatagramPacket generated_packet = file_read_request.newDatagram();

        // Step 2: Verify the generated packet exists
        assertNotNull(generated_packet);

        // Step 3: Verify routing information
        assertEquals(file_read_request.getAddress(), generated_packet.getAddress());
        assertEquals(file_read_request.getPort(), generated_packet.getPort());

        // Manually create the expected payload for comparison
        byte[] expected_payload = createExpectedPayload(resource_name, "netascii");

        // Step 4: Verify packet size
        assertEquals(expected_payload.length, generated_packet.getLength());

        // Step 5: Verify packet content
        byte[] actual_data = new byte[generated_packet.getLength()];
        System.arraycopy(generated_packet.getData(), generated_packet.getOffset(), actual_data, 0, generated_packet.getLength());
        assertArrayEquals(expected_payload, actual_data);

        // Step 6: Prepare a new packet structure
        DatagramPacket prepared_packet = new DatagramPacket(new byte[expected_payload.length], expected_payload.length);

        // Step 7: Direct the packet to the local system address
        prepared_packet.setAddress(local_network_destination);
        prepared_packet.setPort(port);

        // Step 8: Populate the prepared packet
        // This method is package-private, so this test must be in the same package.
        file_read_request.newDatagram(prepared_packet, prepared_packet.getData());

        // Step 9: Verify populated packet's routing information
        assertEquals(file_read_request.getAddress(), prepared_packet.getAddress());
        assertEquals(file_read_request.getPort(), prepared_packet.getPort());

        // Step 10: Verify populated packet's content
        assertArrayEquals(expected_payload, prepared_packet.getData());
    }

    private byte[] createExpectedPayload(String filename, String mode) throws IOException {
        ByteArrayOutputStream baos = new ByteArrayOutputStream();
        // Opcode for RRQ is 1
        baos.write(0);
        baos.write(1);
        baos.write(filename.getBytes());
        baos.write(0);
        baos.write(mode.getBytes());
        baos.write(0);
        return baos.toByteArray();
    }
}

